import React from 'react';
import './Hero.css';

const Hero = () => {
  return (
    <section className="hero">
      <div className="container">
        <div className="hero-content">
          <h1>SHARUBATI</h1>
          <h2>Artisanal Juices & Goods</h2>
          <p>Where every sip tells a story of Arabic roots and Kenyan soul.</p>
          <a href="#menu" className="btn">Explore Our Menu</a>
        </div>
      </div>
    </section>
  );
};

export default Hero;
